/* harmony default export */ __webpack_exports__["default"] = ("<ion-header class=\"ion-no-border\" mode=\"ios\">\n  <div class=\"div-header\">\n  <ion-toolbar class=\"header-styles\">\n    <ion-title><img class=\"content-image\" src=\"../../../assets/img/LOGOS/LOGOS DRAZAMED_Mesa de trabajo 1.png\" alt=\"\"></ion-title>\n  </ion-toolbar>\n    <ion-buttons>\n      <ion-menu-button slot=\"start\" menu=\"main-menu\"></ion-menu-button>\n    </ion-buttons>\n  </div>\n</ion-header>\n\n\n<ion-content>\n  <ion-grid>\n    <ion-row>\n      <ion-col size=\"12\">\n          <div class=\"panel\">\n            <h4 class=\"title1\">Documentos de Interés</h4>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../avisoprivacidad/\">Aviso de privacidad</a></h4>\n            </ion-row>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../acercade/\">Términos y Condiciones</a></h4>\n            </ion-row>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../politicagarantia/\">Política de Garantías</a></h4>\n            </ion-row>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../politicadevolucion/\">Política de Devoluciones</a></h4>\n            </ion-row>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../politicaretracto/\">Política de Retracto y Reversión</a></h4>\n            </ion-row>\n            <ion-row>\n              <h4 class=\"title1\"><a href=\"../manejodatos/\">Manejo de datos Personales</a></h4>\n            </ion-row>\n          </div>\n      </ion-col>\n    </ion-row>\n  </ion-grid>\n\n  <ion-grid>\n    <ion-row>\n      <ion-col size=\"12\">\n        <div class=\"panel\" style=\"font-size: 100%;\">\n          <h1 class=\"title\">POLÍTICA DE DEVOLUCIONES O CAMBIOS DRAZAMED.</h1>\n          <br>\n          Podra descargar una version en PDF de este documento <a href=\"http://dra.devel/assets/pdf/terminos.pdf\"> aqui </a>\n          <p>\n              La siguiente política se encarga de regular las circunstancias y procedimientos encaminados devoluciones o cambios para las compras de los productos vendidos mediante métodos a distancia (entiéndase a domicilio) tales como lo son las ventas que se realizan mediante la aplicación o el sitio web (en adelante los portales) o en expendios de carácter físico de DROGUERIA MINIFARMA S.A.S.\n              <br>\n              Productos que no podrán ser objeto de devolución o cambio.\n              <br>\n              Los productos que no podrán ser objeto del procedimiento de devoluciones son los siguientes:\n        \n              </p><ol>\n                  <li>\n                      Los productos de tipo perecedero.\n                  </li>\n                  <li>\n                      Los productos destinados a consumo.\n                  </li>\n                  <li>\n                      Los productos destinados al aseo personal.\n                  </li>\n                  <li>\n                      Los productos que se encuentren con desgastes en sus empaques, coberturas, precintos, cintillas de seguridad o demás atributos del embalaje del producto.\n                  </li>\n                  <li>\n                      Los productos que tengan alterada la información que se encuentra adjunta al producto.\n                  </li>\n                  <li>\n                      Los productos que hayan sido usados o que su contenido neto se encuentre incompleto de conformidad con la información dispuesta dentro de las indicaciones del empaque o embalaje de este.\n                  </li>\n                  <li>\n                      Que los productos no correspondan a los lotes que se encontraban en poder del expendedor.\n                  </li>\n                  <li>\n                      Los productos que se encuentren vencidos, salvo que la fecha de vencimiento se hubiese causado antes de la fecha de la compra.\n                  </li>\n                  <li>\n                      Productos cosméticos.\n                  </li>\n                  <li>\n                      Medicamentos que por sus características requieran condiciones de refrigeración\n                  </li>\n                  <li>\n                      Productos farmacéuticos y medicinales.\n                  </li>\n                  <li>\n                      Medicamentos de control especial vendidos bajo formula médica.\n                  </li>\n                  <li>\n                      Los que no cuenten con algún daño y/o incongruencia de acuerdo con sus características y funcionalidades del producto.\n                  </li>\n              </ol>\n        \n          <p></p>\n        \n          <h2> Oportunidad para realizar la solicitud de devolución o cambio. </h2>\n        \n          <p>\n              La oportunidad para ejercer el derecho de devolver o solicitar el cambio del producto se tendrá que dar dentro de las veinticuatro (24) horas siguientes a la recepción del producto que se envíe a domicilio hasta el sitio indicado por el cliente que haya adquirido sus productos mediante los portales, o de la recepción de este dentro del punto físico.\n              <br>\n              Después del transcurso del término anteriormente señalado, se entiende que el cliente recibe a satisfacción el producto y no tendrá la oportunidad de realizar cualquier petición frente al mismo.\n          </p>\n        \n          <h2> Procedimiento para solicitar la devolución o cambio. </h2>\n        \n          <p>\n              El procedimiento para efectos de solicitar la devolución o cambio de los productos será el siguiente:\n        \n              </p><ol>\n                  <li>\n                      Una vez recibido el producto, el cliente dentro del término tendrá la oportunidad de comunicarse con DROGUERIA MINIFARMA S.A.S. para informar su deseo de hacer el cambio mediante los siguientes medios:\n        \n                      <ol type=\"a\">\n                          <li>\n                             Al correo electrónico  <a href=\"mailto:info@drazamed.com\">info@drazamed.com</a>\n                          </li>\n                          <li>\n                              Dejando un mensaje en el apartado de PQR´S de cualquiera de los portales.\n                          </li>\n                      </ol>\n                  </li>\n                  <li>\n                      Para efectos de realizar la reclamación se requiere en principio allegar por cualquier medio a DROGUERIA MINIFARMA S.A.S. la factura de venta, para efectos de identificar, fechas, características del producto, precios y demás información importante de los productos objeto de la compraventa.\n                  </li>\n                  <li>\n                      na vez recibida la solicitud de retracto DROGUERIA MINIFARMA S.A.S. deberá responder dentro de los cinco (5) días siguientes a la recepción de esta.\n                  </li>\n                  <li>\n                      Si la respuesta es negativa, lo informará presentando los argumentos que sustentan a la misma.\n                  </li>\n                  <li>\n                      Si la respuesta es positiva, DROGUERIA MINIFARMA S.A.S. comunicará al cliente dicha decisión. En este caso el consumidor deberá devolver el producto a DROGUERIA MINIFARMA S.A.S. por el mismo medio en que lo recibió y deberá estar en las mismas condiciones en que lo recibió.\n                  </li>\n                  <li>\n                      Si el cliente lo comunica de manera expresa en su solicitud, podrá solicitar que sea recogido en el lugar en donde recibió el producto. El cliente en este caso deberá asumir el costo del transporte para la recolección del producto, el cual será informado en la respuesta afirmativa descrita en el numeral inmediatamente anterior.\n                  </li>\n                  <li>\n                      A pesar de que la respuesta de DROGUERIA MINIFARMA S.A.S. sea positiva, el domiciliario podrá revisar el producto y si ve cualquier desperfecto señalado en la presente política, podrá negarse a realizar la respectiva devolución del dinero o cambio según corresponda.\n                  </li>\n                  <li>\n                      Una vez aceptado el producto por parte del domiciliario y hecha la devolución del dinero, el cliente deberá firmar una copia simple de la factura en la que acepta que se le devolvió la suma a la que asciende la devolución o que recibió el nuevo producto, y que declara a paz y salvo por todo concepto a DROGUERIAS MINIFARMA S.A.S.\n                  </li>\n                  <li>\n                      No obstante, al procedimiento anteriormente descrito, el consumidor se podrá acercar a cualquier expendio de DROGUERIAS MINIFARMA S.A.S. dentro del término establecido en la presente política, para que se adelante el cambio o la devolución, siempre que se cumpla con los requisitos aquí previstos y esta sea procedente.\n                  </li>\n              </ol>\n              Las devoluciones de dinero sólo operarán una vez se realice el cambio y el nuevo producto presente las mismas o nuevas inconformidades. Para que la devolución se produzca se deberá agotar el mismo procedimiento que se relaciona dentro de la presente política.\n          <p></p>\n        </div>\n      </ion-col>\n    </ion-row>\n  </ion-grid>\n</ion-content>");

